import React from 'react'
import '../App.css'
import user from "./Images/user_profile.png";




export default function Dashboard() {
  return (
    <>

<ul>
  <li><a href="#home"><img src={user} class="img-thumbnail" alt="..."></img></a></li>
  <li><a href="#home">My Profile</a></li>
  <li><a href="#news">Create Event</a></li>
  <li><a href="#contact">My Events</a></li>
  <li><a href="#about">Logout</a></li>
</ul>
    </>
  )
}
